import { MenuButton, MenuItem, MenuList, Avatar, Menu, Flex } from "@chakra-ui/react";
import React from "react";
import { Container } from "react-bootstrap";

const Navbar = () => {
  return (
    <Container bg="gray.500" p={2}>
      <Flex></Flex>
      <Menu>
        <MenuButton>
          <Avatar />
        </MenuButton>
        <MenuList>
          <MenuItem>Profile</MenuItem>
          <MenuItem>Sttings</MenuItem>
        </MenuList>
      </Menu>
    </Container>
  );
};

export default Navbar;
